import ImageBox from "./ImageBox";
import Container from 'react-bootstrap/Container'
import {Col, Row} from "react-bootstrap"

function BigHeading(){
    return(
        <div className="BigHeadingBox AnotherShadeBox">
        <Container><Row>
        <Col className='MidText' xs={12} md={12} lg={5}>
            <ImageBox 
                PictureSource="Maam.gif" 
                PictureAlternateText="ProfilePictureMissing"
                // ToBack={true}
                className="BigPicture"
                // Grey="true"
            />
        </Col>
        <Col xs={12} md={12} lg={2}></Col>
        <Col xs={12} md={12} lg={5}>
            <div >

                <h1 className="CursiveFont VyLgFont TopNavMargin GreenFontShade">
                    My Diet<br></br> My Way
                </h1> 

                <h4 className="GreyFontShade SmFont NonCursiveFont UppercaseText">  Hi! I'm Rashu and I'm A Certified
                    Health Nutritionist </h4>

            </div>
        </Col>
        </Row></Container>
        </div>
    );
}

export default BigHeading;
